function nodeTemp(){
    return '<div style="width:100%;height:100%;background-color:yellow"></div>';
}
function htmlContent() {
    var div = document.createElement('div');
    div.style.width = '100%';
    div.style.height = '100%';
    div.style.backgroundColor = 'red';
    return div;
}
let div = htmlContent();
describe('code-coverage base methods', () => {
    let diagram: Diagram;
    let ele: HTMLElement;
    beforeAll((): void => {
        const isDef = (o: any) => o !== undefined && o !== null;
            if (!isDef(window.performance)) {
                console.log("Unsupported environment, window.performance.memory is unavailable");
                this.skip(); //Skips test (in Chai)
                return;
            }
        ele = createElement('div', { id: 'diagramBase' });
        document.body.appendChild(ele);
        let nodes:NodeModel[] = [
            {
                id: "node0",
                offsetX: 100,
                offsetY: 100,
                width: 100,
                height: 100,
                shape: { type: "HTML", },
                style: { fill: 'yellow' }
            },
            {
                id:'group',children:['node0'],padding:{left:10,right:10,top:10,bottom:10}
            }
           
        ];
        diagram = new Diagram({
            width: '1000px', height: '600px',
            nodes:nodes,
            nodeTemplate: nodeTemp,
            getNodeDefaults: function (node:NodeModel) {
                if(node.id === 'group'){
                    node = {addInfo:['group']};
                }else{
                    node = {shape:{content:div},addInfo:[[{name:'node'}]]}
                }
                return node;
            }
        });
        diagram.appendTo('#diagramBase');
    });
    afterAll((): void => {
        diagram.destroy();
        ele.remove();
        // Remove references held by template content to avoid leaks across tests
        (div as any) = null;
        (diagram as any) = null; (ele as any) = null;
    });

    it('Checking node template with functional template', (done: Function) => {
        let node: NodeModel = diagram.getObject('node0');
        expect(node.shape.type === 'HTML').toBe(true);
        done();
    });
    it('Checking clone methods', (done: Function) => {
        let group: NodeModel = diagram.getObject('group');
        cloneArray([[group]]);
        cloneArray(undefined);
        expect(group.children.length === 1).toBe(true);
        done();
    });
});